	[10038] = "{id = 10038, NameZh = '艾吉欧蜈蚣', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1003, AdventureValue = 27, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Insect', Nature = 'Poison', Shape = 'L', Body = 10024, HeadDefaultColor = 0, Icon = 'Argiope', SpawnSE = '', DeathEffect = '', Desc = '领地占有欲望很强的大型虫类，第一次看到它都会被其外型吓到。身体由许多体节组成，每一节上均长有步足。令其最为头疼的就是足部护理，每次被问起有多少只脚就会变得很暴躁！', Dead_Reward = {10380}, Level = 43, BaseExp = 332, JobExp = 157, Str = 13, Dex = 14, Agi = 28, Luk = 6, Atk = 84, MAtk = 56, Def = 86, MDef = 6, Hp = 6657, Hit = 63, Flee = 82, MoveSpd = 60, MoveSpdRate = 1, Scale = 1.4, AtkSpd = 0.75, Transform_Skill = {10000001, 10023001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 182001}",
