	[10040] = "{id = 10040, NameZh = '兵蚁', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1101, AdventureValue = 26, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Insect', Nature = 'Earth', Shape = 'S', Body = 10051, HeadDefaultColor = 0, Icon = 'Ant2', SpawnSE = '', DeathEffect = '', Desc = '普通的蚁种之一，主要职责是警卫和战斗。其上颚发达、巨大，可以粉碎坚硬食物，在保卫群体时即成为战斗的武器。身为最忠实的粉丝，绝对服从蚁后的一切命令。', Dead_Reward = {10400}, Level = 40, BaseExp = 269, JobExp = 169, Str = 22, Dex = 21, Agi = 38, Luk = 18, Atk = 76, MAtk = 51, Def = 63, MDef = 16, Hp = 8156, Hit = 60, Flee = 38, MoveSpd = 55, MoveSpdRate = 1.5, AtkSpd = 0.6, Transform_Skill = {10000001, 10023001}, move = 0, Behaviors = 11, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 163001}",
	[10041] = "{id = 10041, NameZh = '工蚁', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1102, AdventureValue = 27, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Insect', Nature = 'Earth', Shape = 'S', Body = 10052, HeadDefaultColor = 0, Icon = 'Ant3', SpawnSE = '', DeathEffect = '', Desc = '普通的蚁种之一，职责是建造和扩大保卫蚁穴、采集食物、伺喂幼蚁及蚁后等。其上颚发达、巨大，可以粉碎坚硬食物，在保卫群体时即成为战斗的武器。蚁族的利益至上！', Dead_Reward = {10410}, Level = 42, BaseExp = 280, JobExp = 179, Str = 7, Dex = 18, Agi = 27, Luk = 42, Atk = 81, MAtk = 54, Def = 26, MDef = 12, Hp = 9056, Hit = 62, Flee = 36, MoveSpd = 55, MoveSpdRate = 1.5, AtkSpd = 0.6, Transform_Skill = {10000001, 10023001}, move = 0, Behaviors = 11, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 14001}",
	[10042] = "{id = 10042, NameZh = '白蚁', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1103, AdventureValue = 27, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Insect', Nature = 'Earth', Shape = 'S', Body = 10050, HeadDefaultColor = 0, Icon = 'Ant', SpawnSE = '', DeathEffect = '', Desc = '蚂蚁种群中的普通蚁类，职责是监督兵蚁和工蚁干活…管理和监督是门艺术活，需要完善的计划安排和协调沟通。不要惹恼它，否则…否则…工蚁、白蚁，上啊！', Dead_Reward = {10420}, Level = 44, BaseExp = 290, JobExp = 189, Str = 2, Dex = 22, Agi = 30, Luk = 34, Atk = 86, MAtk = 57, Def = 22, MDef = 12, Hp = 9956, Hit = 64, Flee = 34, MoveSpd = 50, MoveSpdRate = 1.7, AtkSpd = 0.6, Transform_Skill = {10000001, 10023001}, move = 0, Behaviors = 11, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 354001}",
	[10043] = "{id = 10043, NameZh = '红蝙蝠', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1202, AdventureValue = 27, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Brute', Nature = 'Shadow', Shape = 'S', Body = 10026, HeadDefaultColor = 0, Icon = 'Drainliar', SpawnSE = '', DeathEffect = '', Desc = '吸血蝙蝠的变异进化版，飞行速度更快，喜欢成群结队地攻击玩家们。对其而言，血液是绝对无法免疫的诱惑。可别因为其体型小而轻视，两颗吸血的獠牙对任何生物可是不小的威胁。', Dead_Reward = {10430}, Level = 46, BaseExp = 378, JobExp = 155, Str = 3, Dex = 8, Agi = 12, Luk = 5, Atk = 91, MAtk = 60, Def = 41, MDef = 0, Hp = 10856, Hit = 66, Flee = 60, MoveSpd = 50, MoveSpdRate = 1.4, Scale = 0.8, AtkSpd = 0.6, Transform_Skill = {10000001, 10028001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 301001}",
	[10044] = "{id = 10044, NameZh = '黑蚁', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1203, AdventureValue = 28, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Insect', Nature = 'Earth', Shape = 'S', Body = 10053, HeadDefaultColor = 0, Icon = 'Black_Ant', SpawnSE = '', DeathEffect = '', Desc = '蚂蚁种群中的大型蚁类，除了迁移和筑巢外，极少外出活动，但发育最为完全，专门生育繁殖后代。体型比起普通蚂蚁会大不少，同样还具有不俗的战斗力。敢惹我蚁族？等着瞧！', Dead_Reward = {10440}, Level = 47, BaseExp = 318, JobExp = 198, Str = 26, Dex = 32, Agi = 11, Luk = 11, Atk = 93, MAtk = 62, Def = 0, MDef = 22, Hp = 11306, Hit = 67, Flee = 40, MoveSpd = 60, MoveSpdRate = 1.7, Scale = 0.5, AtkSpd = 0.6, Transform_Skill = {10000001, 10023001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 144001}",
	[10045] = "{id = 10045, NameZh = '基尔瑟', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1204, AdventureValue = 28, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Demon', Nature = 'Earth', Shape = 'S', Body = 20015, HeadDefaultColor = 0, Icon = 'Giearth', SpawnSE = '', DeathEffect = '', Desc = '资深矿工，拥有多年的挖矿经验，对于各类洞穴突发事件应付自如。常年生活工作在漆黑的洞穴和矿井中，不喜与人打交道。如果打搅其专心挖矿，他可会用铲柄好好伺候的！', Dead_Reward = {10450}, Level = 48, BaseExp = 329, JobExp = 200, Str = 33, Dex = 7, Agi = 17, Luk = 8, Atk = 96, MAtk = 63, Def = 86, MDef = 20, Hp = 11756, Hit = 68, Flee = 58, MoveSpd = 60, MoveSpdRate = 2, Scale = 0.65, AtkSpd = 0.6, Transform_Skill = {10000001, 10024001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 117001}",
	[10046] = "{id = 10046, NameZh = '摩卡', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1104, AdventureValue = 28, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Plant', Nature = 'Earth', Shape = 'L', Body = 10056, HeadDefaultColor = 0, Icon = 'Muka', SpawnSE = '', DeathEffect = '', Desc = '栖息于沙漠的怪异仙人掌，不会主动攻击人。但在沙漠中口渴想拿它来解渴的话，要有变成刺猬的觉悟。天生乐观，喜好沙漠风的音乐并为之摇摆。', Dead_Reward = {10460}, Level = 49, BaseExp = 391, JobExp = 171, Str = 29, Dex = 38, Agi = 25, Luk = 22, Atk = 98, MAtk = 65, Def = 53, MDef = 17, Hp = 14891, Hit = 69, Flee = 32, MoveSpd = 60, MoveSpdRate = 1, AtkSpd = 0.6, Transform_Skill = {10000001, 10028001}, move = 0, Behaviors = 67, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 208001}",
	[10047] = "{id = 10047, NameZh = '大嘴鸟', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1105, AdventureValue = 28, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Brute', Nature = 'Fire', Shape = 'L', Body = 10055, HeadDefaultColor = 0, Icon = 'Pecopeco', SpawnSE = '', DeathEffect = '', Desc = '生活在沙漠和森林交界处的大型鸟类，由小鸡成长进化而成，羽毛鲜艳体型巨大，会发出很奇特的叫声。经过训练之后可以骑乘，是人们比较常用的坐骑之一。', Dead_Reward = {10470}, Level = 50, BaseExp = 394, JobExp = 178, Str = 36, Dex = 41, Agi = 47, Luk = 7, Atk = 101, MAtk = 66, Def = 200, MDef = 14, Hp = 15651, Hit = 70, Flee = 32, MoveSpd = 60, MoveSpdRate = 1, AtkSpd = 0.6, Transform_Skill = {10000001, 10026001, 181001}, move = 0, Behaviors = 67, LoadShowSize = 1, LoadShowRotate = 30, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 124002}",
	[10048] = "{id = 10048, NameZh = '魔锅蛋', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1106, AdventureValue = 28, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Demon', Nature = 'Water', Shape = 'S', Body = 10102, HeadDefaultColor = 0, Icon = 'Magnolia', SpawnSE = '', DeathEffect = '', Desc = '大嘴鸟蛋被打破后变成的怨灵，拿平底锅进行攻击。有着随时变鸡的梦想，但如果和其扯先有鸡还是先有蛋的问题，肯定会挨一顿爆揍…', Dead_Reward = {10480}, Level = 51, BaseExp = 343, JobExp = 216, Str = 1, Dex = 28, Agi = 23, Luk = 10, Atk = 106, MAtk = 69, Def = 66, MDef = 34, Hp = 13513, Hit = 71, Flee = 52, MoveSpd = 60, MoveSpdRate = 1, Scale = 1.4, AtkSpd = 0.6, Transform_Skill = {10000001, 10025001}, move = 0, Behaviors = 8388619, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 301002}",
