	[10050] = "{id = 10050, NameZh = '邪骸士兵', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1401, AdventureValue = 29, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Undead', Nature = 'Undead', Shape = 'M', Body = 10111, HeadDefaultColor = 0, Icon = 'Skeleton_Solider', LeftHand = 40707, RightHand = 40707, SpawnSE = '', DeathEffect = '', Desc = '生前是俄赛里斯的忠实士兵，遗体被复活后拿起手中的武器，继续选择在金字塔履行守护的职责。和波波利是好朋友，无聊时会彼此倾诉…', Dead_Reward = {10500}, Level = 52, BaseExp = 356, JobExp = 216, Str = 30, Dex = 5, Agi = 36, Luk = 45, Atk = 111, MAtk = 72, Def = 212, MDef = 14, Hp = 14362, Hit = 72, Flee = 44, MoveSpd = 60, MoveSpdRate = 1, Scale = 0.8, AtkSpd = 0.6, Transform_Skill = {10000001, 10030001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 163002}",
	[10051] = "{id = 10051, NameZh = '黑狐', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1402, AdventureValue = 29, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Brute', Nature = 'Shadow', Shape = 'M', Body = 10054, HeadDefaultColor = 0, Icon = 'Matyr', SpawnSE = '', DeathEffect = '', Desc = '攻击速度、移动速度超快，对敌人死缠烂打到极点。据说睡觉会美颜变白，所以其只要空下来就会打盹，这时把它吵醒的话可是会被痛扁一顿的。', Dead_Reward = {10510}, Level = 54, BaseExp = 438, JobExp = 185, Str = 13, Dex = 20, Agi = 23, Luk = 32, Atk = 120, MAtk = 77, Def = 70, MDef = 47, Hp = 16058, Hit = 74, Flee = 78, MoveSpd = 75, MoveSpdRate = 2, Scale = 0.75, AtkSpd = 0.6, Transform_Skill = {10000001, 10023001}, move = 0, Behaviors = 35, LoadShowSize = 1, LoadShowRotate = 30, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 210002}",
	[10052] = "{id = 10052, NameZh = '木乃伊', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1403, AdventureValue = 29, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Undead', Nature = 'Undead', Shape = 'M', Body = 10058, HeadDefaultColor = 0, Icon = 'mummy', SpawnSE = '', DeathEffect = '', Desc = '在金字塔深处受诅咒的魔物，复苏后只听命于俄赛里斯。虽然有点呆滞，但其围绕的特殊绷带让其属性变得很强。有冒险者发现它身后有时会跟着宠物木乃伊犬，不知真假。', Dead_Reward = {10520}, Level = 55, BaseExp = 335, JobExp = 253, Str = 48, Dex = 32, Agi = 13, Luk = 50, Atk = 125, MAtk = 80, Def = 231, MDef = 15, Hp = 16907, Hit = 75, Flee = 56, MoveSpd = 60, MoveSpdRate = 1, Scale = 1, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = {10000001, 10028001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 354002}",
	[10053] = "{id = 10053, NameZh = '蛇女伊丝', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1404, AdventureValue = 29, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Demon', Nature = 'Shadow', Shape = 'L', Body = 10060, HeadDefaultColor = 0, Icon = 'Isis', SpawnSE = '', DeathEffect = '', Desc = '上半身裸露、下半身为蛇尾的恶魔，为俄赛里斯之妻。平时在金字塔无微不至地照顾俄赛里斯的生活起居。虽然丈夫绷带缠身，但浓浓的爱意丝毫没有减少。', Dead_Reward = {10530}, Level = 57, BaseExp = 465, JobExp = 194, Str = 2, Dex = 24, Agi = 30, Luk = 55, Atk = 135, MAtk = 87, Def = 75, MDef = 51, Hp = 22826, Hit = 77, Flee = 112, MoveSpd = 60, MoveSpdRate = 1, Scale = 1.3, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = {10000001, 10028001}, move = 0, Behaviors = 8392707, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 182002}",
	[10054] = "{id = 10054, NameZh = '长老树精', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1501, AdventureValue = 29, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Plant', Nature = 'Fire', Shape = 'M', Body = 10045, HeadDefaultColor = 0, Icon = 'Wilow2', SpawnSE = '', DeathEffect = '', Desc = '作为非常古老的树精一族，有着极其长久的树龄。有魔物哲学家的著称，对生活对世界都有着深刻的思考，毕生都在寻找生存意义的终极答案：魔物活着，到底是为了什么……', Dead_Reward = {10540}, Level = 56, BaseExp = 379, JobExp = 235, Str = 50, Dex = 19, Agi = 19, Luk = 48, Atk = 130, MAtk = 84, Def = 180, MDef = 16, Hp = 17756, Hit = 76, Flee = 40, MoveSpd = 80, MoveSpdRate = 2.5, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = {10000001, 10023001, 85010}, move = 0, Behaviors = 2097411, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 121002}",
	[10055] = "{id = 10055, NameZh = '大脚熊', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1502, AdventureValue = 30, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Brute', Nature = 'Earth', Shape = 'L', Body = 10046, HeadDefaultColor = 0, Icon = 'Bigfoot', SpawnSE = '', DeathEffect = '', Desc = '和其兄弟狂暴大脚熊性格截然相反，生性憨厚，喜欢和谐的大自然，因脚掌厚实宽大而备受关注。却无奈老被利欲熏心的坏人陷害，为的只是其皮毛和熊掌。', Dead_Reward = {10550}, Level = 58, BaseExp = 397, JobExp = 241, Str = 33, Dex = 33, Agi = 21, Luk = 23, Atk = 139, MAtk = 89, Def = 252, MDef = 40, Hp = 23851, Hit = 78, Flee = 50, MoveSpd = 65, MoveSpdRate = 1, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = {10000001, 10023001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 14002}",
	[10056] = "{id = 10056, NameZh = '将军魔碑', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1503, AdventureValue = 30, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Formless', Nature = 'Fire', Shape = 'M', Body = 10116, HeadDefaultColor = 0, Icon = 'Greatest_General', SpawnSE = '', DeathEffect = '', Desc = '不知从何考证，古代将军们的墓碑突然有了灵性。墓志铭“天下大将军”诠释了一切：征战沙场，对侵犯领地者豪不手软！奋勇杀敌，哪怕已化为亡魂！', Dead_Reward = {10560}, Level = 60, BaseExp = 411, JobExp = 249, Str = 33, Dex = 38, Agi = 23, Luk = 41, Atk = 144, MAtk = 93, Def = 200, MDef = 17, Hp = 21150, Hit = 80, Flee = 60, MoveSpd = 60, MoveSpdRate = 1, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = {10000002, 10026001}, move = 0, Behaviors = 258, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 93003}",
	[10057] = "{id = 10057, NameZh = '野猪', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1601, AdventureValue = 30, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Brute', Nature = 'Earth', Shape = 'L', Body = 10014, HeadDefaultColor = 0, Icon = 'Savage', SpawnSE = '', DeathEffect = '', Desc = '杂食性动物，体躯健壮，四肢粗短，有厚实的鬃毛和尖锐的獠牙。虽然是猪，但肉很结实，体魄绝对强健。如果不幸将其惹恼，那对致命的獠牙可会让敌人吃不了兜着走！', Dead_Reward = {10570}, Level = 59, BaseExp = 455, JobExp = 216, Str = 23, Dex = 31, Agi = 51, Luk = 14, Atk = 144, MAtk = 92, Def = 195, MDef = 41, Hp = 24876, Hit = 79, Flee = 52, MoveSpd = 60, MoveSpdRate = 1, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = {10000001, 10024001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 310001}",
	[10058] = "{id = 10058, NameZh = '鬼火', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1602, AdventureValue = 30, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Formless', Nature = 'Fire', Shape = 'S', Body = 10078, HeadDefaultColor = 0, Icon = 'Horong', SpawnSE = '', DeathEffect = '', Desc = '亡者的幽灵之火，在不经意期间会悄悄跟随在路人身后进行偷袭。切记：如果发现被其缠上，请迅速逃离，否则很有可能会被攻击致死成为下一个亡魂！', Dead_Reward = {10580}, Level = 62, BaseExp = 423, JobExp = 258, Str = 30, Dex = 25, Agi = 12, Luk = 29, Atk = 174, MAtk = 108, Def = 83, MDef = 59, Hp = 24165, Hit = 82, Flee = 68, MoveSpd = 60, MoveSpdRate = 1, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = {10000001, 10026001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 310002}",
	[10059] = "{id = 10059, NameZh = '转转蛋', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1701, AdventureValue = 30, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Formless', Nature = 'Ghost', Shape = 'M', Body = 10057, HeadDefaultColor = 0, Icon = 'Eggyra', SpawnSE = '', DeathEffect = '', Desc = '生前只是一颗普通的蛋，被伊米尔粉尘沾上后就变成一颗转啊转的蛋了，具有360度旋转抗眩晕的能力。生命的意义在于转动！不转，和普通的蛋有什么区别？', Dead_Reward = {10590}, Level = 61, BaseExp = 309, JobExp = 317, Str = 9, Dex = 39, Agi = 26, Luk = 5, Atk = 159, MAtk = 101, Def = 81, MDef = 43, Hp = 11216, Hit = 81, Flee = 60, MoveSpd = 60, MoveSpdRate = 1, Scale = 0.8, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = {10000001, 10028001}, move = 0, Behaviors = 259, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 354003}",
	[10060] = "{id = 10060, NameZh = '僵尸', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1702, AdventureValue = 31, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Undead', Nature = 'Undead', Shape = 'M', Body = 10048, HeadDefaultColor = 0, Icon = 'Munak', Head = 45043, SpawnSE = '', DeathEffect = '', Desc = '和妖道君青梅竹马，却因家庭因素被迫与心上人形同陌路，后思念过度而早逝。被贴上道符而复活，记忆全无，只能下意识地在寻找当年的那个他…世上最远的距离是在你身边却已无法认出…', Dead_Reward = {10600}, Level = 63, BaseExp = 462, JobExp = 244, Str = 22, Dex = 24, Agi = 1, Luk = 38, Atk = 189, MAtk = 115, Def = 84, MDef = 45, Hp = 25672, Hit = 83, Flee = 45, MoveSpd = 60, MoveSpdRate = 1, Scale = 1.1, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = {10000001, 10023001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 182003}",
	[10061] = "{id = 10061, NameZh = '妖道', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1703, AdventureValue = 31, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Undead', Nature = 'Undead', Shape = 'M', Body = 10049, HeadDefaultColor = 0, Icon = 'Bon_cun', Head = 45044, SpawnSE = '', DeathEffect = '', Desc = '生前在斐扬生活，和僵尸妹青梅竹马，后得知僵尸妹身亡后也抑郁身故。被贴上道符而复活，记忆全无，只能下意识地在寻找当年的那个她…世上最远的距离是在你身边却已无法认出…', Dead_Reward = {10610}, Level = 65, BaseExp = 459, JobExp = 262, Str = 3, Dex = 46, Agi = 4, Luk = 41, Atk = 218, MAtk = 130, Def = 88, MDef = 48, Hp = 28688, Hit = 85, Flee = 47, MoveSpd = 60, MoveSpdRate = 1, Scale = 1.3, AtkSpd = 0.58, AccessRange = 2, Transform_Skill = {10000001, 10023001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 163003}",
	[10062] = "{id = 10062, NameZh = '米诺斯', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1802, AdventureValue = 31, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Brute', Nature = 'Fire', Shape = 'L', Body = 20017, HeadDefaultColor = 0, Icon = 'Minorous', SpawnSE = '', DeathEffect = '', Desc = '其体型巨大且拥有超强的力量，被激怒后会使用巨锤将敌人砸成肉泥。脾气暴躁，但因拥有令人羡慕的厚实肌肉，曾多次被评选为魔物界的健美冠军…', Dead_Reward = {10620}, Level = 64, BaseExp = 507, JobExp = 226, Str = 5, Dex = 41, Agi = 23, Luk = 34, Atk = 203, MAtk = 122, Def = 297, MDef = 19, Hp = 27181, Hit = 84, Flee = 47, MoveSpd = 60, MoveSpdRate = 1, AtkSpd = 0.91, AccessRange = 2, Transform_Skill = {10000001, 10026001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 117003}",
	[10063] = "{id = 10063, NameZh = '邪骸弓箭手', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1803, AdventureValue = 31, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Undead', Nature = 'Undead', Shape = 'M', Body = 10040, HeadDefaultColor = 0, Icon = 'Skeleton', RightHand = 41201, SpawnSE = '', DeathEffect = '', Desc = '生前是一名箭技高超的弓箭手，百发百中。遗体被复活后，更是勤奋训练，喜欢找兽人弓箭手、蝙蝠弓箭手、幽灵弓箭手一起切磋，其独眼射弓的命中率遥遥领先…', Dead_Reward = {10630}, Level = 66, BaseExp = 461, JobExp = 269, Str = 46, Dex = 3, Agi = 56, Luk = 31, Atk = 234, MAtk = 135, Def = 89, MDef = 49, Hp = 30196, Hit = 110, Flee = 20, MoveSpd = 75, MoveSpdRate = 0.8, Scale = 0.8, AtkSpd = 0.35, AccessRange = 2, Transform_Skill = {10001001, 10023001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 121003}",
