	[10065] = "{id = 10065, NameZh = '鬼女', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1901, AdventureValue = 31, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Demon', Nature = 'Water', Shape = 'M', Body = 20014, HeadDefaultColor = 0, Icon = 'Sohee', SpawnSE = '', DeathEffect = '', Desc = '生前是名貌美如花的普通女子，但不知何故最后含恨而死化为鬼魂继续游荡。或许是情愫的羁绊，亦或是反抗的不甘…谁知道呢，每个人都有自己的故事…', Dead_Reward = {10650}, Level = 67, BaseExp = 456, JobExp = 280, Str = 11, Dex = 27, Agi = 40, Luk = 59, Atk = 248, MAtk = 138, Def = 91, MDef = 67, Hp = 31703, Hit = 87, Flee = 66, MoveSpd = 60, MoveSpdRate = 1, AtkSpd = 0.47, AccessRange = 2, Transform_Skill = {10000001, 10025001}, move = 0, Behaviors = 8392707, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 144003}",
	[10066] = "{id = 10066, NameZh = '土人', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1902, AdventureValue = 32, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Demon', Nature = 'Shadow', Shape = 'S', Body = 10103, HeadDefaultColor = 0, Icon = 'Dokebi', SpawnSE = '', DeathEffect = '', Desc = '历史悠久的土著民族，对力量和金钱无比崇尚。虽然在洞穴里长期居住，没有见过太多世面，但还是紧跟潮流，为了获得梦寐以求的三色假发对颜色有特别深的理解。', Dead_Reward = {10660}, Level = 69, BaseExp = 514, JobExp = 263, Str = 3, Dex = 21, Agi = 38, Luk = 18, Atk = 278, MAtk = 144, Def = 340, MDef = 20, Hp = 34720, Hit = 89, Flee = 83, MoveSpd = 60, MoveSpdRate = 2, AtkSpd = 0.86, AccessRange = 2, Transform_Skill = {10000001, 10028001}, move = 0, Behaviors = 8392963, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 14003}",
	[10067] = "{id = 10067, NameZh = '九尾狐', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1903, AdventureValue = 32, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Brute', Nature = 'Fire', Shape = 'M', Body = 10047, HeadDefaultColor = 0, Icon = 'Ninetail', SpawnSE = '', DeathEffect = '', Desc = '有九条尾巴的狐狸。传说中它可以变成艳丽的女人诱惑男人，每条尾巴都有不一样的法力。据说当一只狐狸活了超过一千年，它就会变成九尾狐。如果遇上可要小心，不要被狐魅所迷惑！', Dead_Reward = {10670}, Level = 72, BaseExp = 669, JobExp = 197, Str = 42, Dex = 17, Agi = 0, Luk = 31, Atk = 313, MAtk = 176, Def = 99, MDef = 21, Hp = 44313, Hit = 92, Flee = 131, MoveSpd = 90, MoveSpdRate = 1.6, Scale = 0.4, AtkSpd = 0.49, AccessRange = 2, Transform_Skill = {10000001, 10023001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 30, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 210004}",
	[10068] = "{id = 10068, NameZh = '兽人战士', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2001, AdventureValue = 32, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'DemiHuman', Nature = 'Earth', Shape = 'M', Body = 10041, HeadDefaultColor = 0, Icon = 'Orc', LeftHand = 400048, RightHand = 400047, Head = 45049, SpawnSE = '', DeathEffect = '', Desc = '兽族中最普通的士兵，即使如此，也不能小觑其战斗力。守护兽人村作为其天职，丝毫不会怠慢，时刻摩拳擦掌等待敌人的光临！冲锋陷阵，杀红眼，为了部落！', Dead_Reward = {10680}, Level = 70, BaseExp = 585, JobExp = 229, Str = 8, Dex = 44, Agi = 54, Luk = 6, Atk = 282, MAtk = 159, Def = 350, MDef = 21, Hp = 36238, Hit = 130, Flee = 48, MoveSpd = 60, MoveSpdRate = 1, AtkSpd = 0.54, AccessRange = 2, Transform_Skill = {10000001, 10023001}, move = 0, Behaviors = 16455, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 208004}",
	[10069] = "{id = 10069, NameZh = '兽人弓箭手', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2002, AdventureValue = 32, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'DemiHuman', Nature = 'Earth', Shape = 'M', Body = 10042, HeadDefaultColor = 0, Icon = 'Orc_Archer', RightHand = 41201, Head = 45049, SpawnSE = '', DeathEffect = '', Desc = '兽族中身手矫健、百发百中的远程士兵。从小接受严酷的战斗训练，力量、射程、命中搭配完美，与其对战中可要处处小心，否则下场基本就是被一箭穿心！', Dead_Reward = {10690}, Level = 71, BaseExp = 358, JobExp = 370, Str = 44, Dex = 4, Agi = 54, Luk = 24, Atk = 350, MAtk = 168, Def = 98, MDef = 21, Hp = 40276, Hit = 131, Flee = 93, MoveSpd = 60, MoveSpdRate = 1, AtkSpd = 0.51, AccessRange = 2, Transform_Skill = {10001001, 10023001}, move = 0, Behaviors = 7, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 121004}",
	[10070] = "{id = 10070, NameZh = '兽人战士长', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2003, AdventureValue = 32, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'DemiHuman', Nature = 'Fire', Shape = 'L', Body = 10043, HeadDefaultColor = 0, Icon = 'Orc_Captain', LeftHand = 400048, RightHand = 400047, Head = 45049, SpawnSE = '', DeathEffect = '', Desc = '兽族中从普通士兵精选出来的小队长，拥有强大的力量和过人的头脑，在和敌人对战中往往冲在前线的第一位，视死如归！但在生活中却比较木讷，时不时会遭到兽人士兵的恶作剧…', Dead_Reward = {10700}, Level = 73, BaseExp = 574, JobExp = 260, Str = 14, Dex = 56, Agi = 69, Luk = 17, Atk = 312, MAtk = 181, Def = 272, MDef = 22, Hp = 58851, Hit = 133, Flee = 98, MoveSpd = 100, MoveSpdRate = 1, Scale = 1.2, AtkSpd = 0.67, AccessRange = 2, Transform_Skill = {10000001, 10023001}, move = 0, Behaviors = 7, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 14004}",
	[10071] = "{id = 10071, NameZh = '梦魇', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2101, AdventureValue = 33, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Demon', Nature = 'Ghost', Shape = 'L', Body = 10030, HeadDefaultColor = 0, Icon = 'Nightmare', SpawnSE = '', DeathEffect = '', Desc = '拥有控制梦境能力的魔兽。若被其攻击，会被恐惧所笼罩。曾经有人试图将其驯服作为宠物，但结局却是一场噩梦…珍惜生命，远离梦魇！', Dead_Reward = {10710}, Level = 74, BaseExp = 381, JobExp = 381, Str = 5, Dex = 28, Agi = 35, Luk = 26, Atk = 344, MAtk = 185, Def = 103, MDef = 79, Hp = 29627, Hit = 134, Flee = 123, MoveSpd = 90, MoveSpdRate = 1, AtkSpd = 0.55, AccessRange = 2, Transform_Skill = {10000001, 10023001}, move = 0, Behaviors = 8392707, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 117004}",
	[10072] = "{id = 10072, NameZh = '傀儡娃娃', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2102, AdventureValue = 33, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Demon', Nature = 'Ghost', Shape = 'S', Body = 10072, HeadDefaultColor = 0, Icon = 'Marionette', SpawnSE = '', DeathEffect = '', Desc = '娃娃造型的木偶，没有太多的主动意识。也有传闻，生前是姑娘，被凶手害死后伪装成娃娃木偶，阴魂不散，始终徘徊寻找着凶手以待复仇！被其手上的蜡烛台攻击到可是非常疼的！', Dead_Reward = {10720}, Level = 77, BaseExp = 355, JobExp = 420, Str = 54, Dex = 58, Agi = 14, Luk = 73, Atk = 390, MAtk = 196, Def = 108, MDef = 23, Hp = 33116, Hit = 137, Flee = 103, MoveSpd = 60, MoveSpdRate = 1, AtkSpd = 0.68, AccessRange = 2, Transform_Skill = {10000001, 10023001}, move = 0, Behaviors = 524387, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 78002}",
	[10073] = "{id = 10073, NameZh = '小恶魔', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2103, AdventureValue = 34, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Demon', Nature = 'Shadow', Shape = 'S', Body = 10028, HeadDefaultColor = 0, Icon = 'Deviruchi', RightHand = 400046, SpawnSE = '', DeathEffect = '', Desc = '恶魔种族里的小捣蛋鬼，喜欢捉弄玩耍猎物。一旦被其盯上就很难脱身。其手上拿的小三叉戟附有黑暗的魔力，一旦被其触碰便会心智异常！', Dead_Reward = {10730}, Level = 80, BaseExp = 614, JobExp = 294, Str = 50, Dex = 51, Agi = 52, Luk = 48, Atk = 423, MAtk = 207, Def = 114, MDef = 92, Hp = 76621, Hit = 140, Flee = 115, MoveSpd = 100, MoveSpdRate = 1, AtkSpd = 0.67, AccessRange = 2, Transform_Skill = {10000001, 10028001}, move = 0, Behaviors = 8392707, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 14005}",
	[10074] = "{id = 10074, NameZh = '兽人腐尸', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2201, AdventureValue = 33, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Undead', Nature = 'Undead', Shape = 'M', Body = 10038, HeadDefaultColor = 0, Icon = 'Orc_Zombie', RightHand = 400047, Head = 45049, SpawnSE = '', DeathEffect = '', Desc = '生前是普通的兽人战士，由于多次征战沙场而长埋于地下。复活后，身躯虽已腐烂不堪，但任凭借自己仅存的一些意识来守卫属于兽人的领土，对侵略者只有三个字：杀无赦！', Dead_Reward = {10740}, Level = 75, BaseExp = 511, JobExp = 313, Str = 36, Dex = 49, Agi = 33, Luk = 67, Atk = 360, MAtk = 188, Def = 105, MDef = 23, Hp = 56426, Hit = 135, Flee = 36, MoveSpd = 35, MoveSpdRate = 0.5, AtkSpd = 0.35, AccessRange = 2, Transform_Skill = {10000001, 10023001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 182004}",
	[10075] = "{id = 10075, NameZh = '邪骸兽人', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2202, AdventureValue = 33, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Undead', Nature = 'Undead', Shape = 'M', Body = 10104, HeadDefaultColor = 0, Icon = 'Orc_Skeleton', LeftHand = 400048, RightHand = 400047, Head = 45049, SpawnSE = '', DeathEffect = '', Desc = '生前可是英勇威猛的兽人高级战士，复活后凭借不死的状态更是凶猛无比，对一切侵袭兽人领地的不速之客给予最严厉的打击！终生只贯彻一个信念：为了部落！', Dead_Reward = {10750}, Level = 78, BaseExp = 530, JobExp = 326, Str = 41, Dex = 17, Agi = 69, Luk = 69, Atk = 406, MAtk = 199, Def = 110, MDef = 24, Hp = 68538, Hit = 138, Flee = 42, MoveSpd = 60, MoveSpdRate = 1.6, Scale = 1.2, AtkSpd = 0.41, AccessRange = 2, Transform_Skill = {10000001, 10030001}, move = 0, Behaviors = 16387, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 163004}",
	[10076] = "{id = 10076, NameZh = '赤苍蝇', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2203, AdventureValue = 34, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Insect', Nature = 'Wind', Shape = 'S', Body = 10098, HeadDefaultColor = 0, Icon = 'HunterFly', SpawnSE = '', DeathEffect = '', Desc = '由苍蝇变异而成，拥有不俗的攻击力。小而强悍，战斗经验丰富，绝对是苍蝇界的老兵。平时除了嗡嗡嗡外，口头禅就是“我小，但我很温柔…”。', Dead_Reward = {10760}, Level = 81, BaseExp = 546, JobExp = 342, Str = 0, Dex = 38, Agi = 30, Luk = 46, Atk = 463, MAtk = 211, Def = 327, MDef = 68, Hp = 80001, Hit = 141, Flee = 147, MoveSpd = 125, MoveSpdRate = 1, AtkSpd = 0.67, AccessRange = 2, Transform_Skill = {10000001, 10023001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 354005}",
	[10077] = "{id = 10077, NameZh = '毕帝特飞龙', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2302, AdventureValue = 34, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Dragon', Nature = 'Wind', Shape = 'M', Body = 10061, HeadDefaultColor = 0, Icon = 'Petit_F', SpawnSE = '', DeathEffect = '', Desc = '龙族中比较普通的一种。别看个小和飞的高度，这可是货真价实的飞龙！早期米德加尔特的传奇冒险家毕帝特离开吉芬探索中无意间发现了龙区，后人就将普通的龙系魔物冠以他的名字…', Dead_Reward = {10770}, Level = 76, BaseExp = 518, JobExp = 317, Str = 1, Dex = 64, Agi = 21, Luk = 44, Atk = 416, MAtk = 192, Def = 50, MDef = 10, Hp = 84000, Hit = 225, Flee = 75, MoveSpd = 135, MoveSpdRate = 1, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = {10000001, 10028001}, move = 0, GroupID = 10077, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 82002}",
	[10078] = "{id = 10078, NameZh = '毕帝特地龙', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2301, AdventureValue = 33, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Dragon', Nature = 'Earth', Shape = 'M', Body = 10062, HeadDefaultColor = 0, Icon = 'Petit', SpawnSE = '', DeathEffect = '', Desc = '龙族中比较普通的一种，只能在地面生活。早期米德加尔特的传奇冒险家毕帝特离开吉芬探索中无意间发现了龙区，后人就将普通的龙系魔物冠以他的名字…', Dead_Reward = {10780}, Level = 79, BaseExp = 537, JobExp = 331, Str = 21, Dex = 2, Agi = 12, Luk = 50, Atk = 458, MAtk = 88, Def = 65, MDef = 15, Hp = 85440, Hit = 139, Flee = 88, MoveSpd = 60, MoveSpdRate = 1, Scale = 1.2, AtkSpd = 0.8, AccessRange = 2, Transform_Skill = {10000001, 10023001}, move = 0, GroupID = 10077, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 144004}",
	[10079] = "{id = 10079, NameZh = '绿贝勒斯', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2304, AdventureValue = 34, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Dragon', Nature = 'Earth', Shape = 'L', Body = 10063, HeadDefaultColor = 0, Icon = 'Ferus', SpawnSE = '', DeathEffect = '', Desc = '龙族中比较高级的一种。通体翠绿，最为显著的是那致命的刺锤尾部。对钱财珠宝本身毫无兴趣，最大的爱好却是收集金灿灿的东西。据说其巢穴埋藏的金子钱币不计其数，但打其主意的冒险者都空手而归甚至丧命于此！', Dead_Reward = {10790}, Level = 82, BaseExp = 732, JobExp = 242, Str = 47, Dex = 18, Agi = 50, Luk = 33, Atk = 363, MAtk = 455, Def = 0, MDef = 30, Hp = 94000, Hit = 142, Flee = 135, MoveSpd = 60, MoveSpdRate = 1, Scale = 0.8, AtkSpd = 0.7, AccessRange = 2, Transform_Skill = {10000001, 10025001}, move = 0, GroupID = 10077, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 163005}",
	[10080] = "{id = 10080, NameZh = '恶灵', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2521, AdventureValue = 34, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Undead', Nature = 'Undead', Shape = 'L', Body = 10135, HeadDefaultColor = 0, Icon = 'Wraith', SpawnSE = '', DeathEffect = '', Desc = '怨念极强，拥有非常可怕的破坏能量。由于没有实质形体，而且其披风具有隐身作用，所以他们可以轻易地消失在敌人眼前。最喜欢做的事情就是用胸口的大嘴来吞噬敌人，将其灵魂拖入无尽的深渊…', Dead_Reward = {10800}, Level = 83, BaseExp = 625, JobExp = 312, Str = 30, Dex = 15, Agi = 43, Luk = 60, Atk = 387, MAtk = 223, Def = 350, MDef = 0, Hp = 86000, Hit = 160, Flee = 141, MoveSpd = 125, MoveSpdRate = 1, Scale = 1.4, AtkSpd = 1, AccessRange = 2, Transform_Skill = {10000001, 10028001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 301003}",
	[10081] = "{id = 10081, NameZh = '蝙蝠弓箭手', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2522, AdventureValue = 35, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Demon', Nature = 'Wind', Shape = 'M', Body = 10027, HeadDefaultColor = 0, Icon = 'Gargoyle', RightHand = 41201, SpawnSE = '', DeathEffect = '', Desc = '传闻是由远古的石像鬼进化而成，拥有蝙蝠翅膀的类人形生物。十分畏惧阳光，常年呆在底下，用弓箭袭击来往的路人。箭法高超，遇见的话小心一箭穿心！', Dead_Reward = {10810}, Level = 86, BaseExp = 443, JobExp = 443, Str = 5, Dex = 19, Agi = 17, Luk = 69, Atk = 655, MAtk = 247, Def = 0, MDef = 50, Hp = 65000, Hit = 400, Flee = 93, MoveSpd = 65, MoveSpdRate = 1, AtkSpd = 0.4, AccessRange = 2, Transform_Skill = {10001001, 10023001}, move = 0, Behaviors = 8392707, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 124005}",
	[10082] = "{id = 10082, NameZh = '恶魔女仆', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2501, AdventureValue = 34, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Demon', Nature = 'Shadow', Shape = 'M', Body = 10066, HeadDefaultColor = 0, Icon = 'Succubus', SpawnSE = '', DeathEffect = '', Desc = '在她性感妖娆的外表下潜伏着致命的危险。虽然其恶魔之飞吻会让人沉醉其中无法自拔，但其头上的恶魔角和身后的恶魔翅膀终究证明其目的是吞噬对方的灵魂！', Dead_Reward = {10820}, Level = 80, BaseExp = 469, JobExp = 378, Str = 66, Dex = 61, Agi = 12, Luk = 45, Atk = 446, MAtk = 82, Def = 20, MDef = 60, Hp = 85450, Hit = 190, Flee = 130, MoveSpd = 85, MoveSpdRate = 1, Scale = 1.1, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = {10002001, 10028001}, move = 0, GroupID = 10080, Behaviors = 8392707, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 144005}",
	[10083] = "{id = 10083, NameZh = '恶魔侍者', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2502, AdventureValue = 34, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Demon', Nature = 'Shadow', Shape = 'M', Body = 10065, HeadDefaultColor = 0, Icon = 'Incubus', SpawnSE = '', DeathEffect = '', Desc = '在他帅气俊美的外表下潜伏着致命的危险。虽然其恶魔之玫瑰会让人深情投入难以忘怀，但其头上的恶魔角和身后的恶魔翅膀终究证明其目的是吞噬对方的灵魂！', Dead_Reward = {10830}, Level = 81, BaseExp = 476, JobExp = 382, Str = 69, Dex = 11, Agi = 86, Luk = 45, Atk = 451, MAtk = 243, Def = 25, MDef = 100, Hp = 95000, Hit = 190, Flee = 90, MoveSpd = 75, MoveSpdRate = 1, Scale = 1.2, AtkSpd = 0.5, AccessRange = 2, Transform_Skill = {10000001, 10028001}, move = 0, GroupID = 10080, Behaviors = 8392707, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 78003}",
	[10084] = "{id = 10084, NameZh = '深渊骑士', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2503, AdventureValue = 34, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'DemiHuman', Nature = 'Shadow', Shape = 'L', Body = 20022, HeadDefaultColor = 0, Icon = 'Abyssknight', SpawnSE = '', DeathEffect = '', Desc = '生前叱咤战场，死后战意依旧，成为来自深渊的恐怖骑士，忠实地守卫着克雷斯特汉姆古城，对所有侵入者无情而残暴。据说破解其携带的旗帜上刻印的图腾后能获取无尽的力量…', Dead_Reward = {10840}, Level = 82, BaseExp = 505, JobExp = 374, Str = 84, Dex = 10, Agi = 3, Luk = 40, Atk = 863, MAtk = 252, Def = 408, MDef = 50, Hp = 553546, Hit = 220, Flee = 147, MoveSpd = 125, MoveSpdRate = 1, Scale = 1.4, AtkSpd = 1, AccessRange = 2, Transform_Skill = {10000001, 10028001}, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 310003}",
	[10085] = "{id = 10085, NameZh = '蓝鼠', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2601, AdventureValue = 34, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Brute', Nature = 'Poison', Shape = 'S', Body = 10107, HeadDefaultColor = 0, Icon = 'Cramp', SpawnSE = '', DeathEffect = '', Desc = '首都地下水道白鼠的表亲，在古城遭遇了异变。蓝色的毛皮下藏着一颗向往光明和自由的心。可不要小看这种可爱的生物，其变异后的速度和攻击强度可是会让人措手不及的！', Dead_Reward = {10850}, Level = 83, BaseExp = 545, JobExp = 359, Str = 30, Dex = 15, Agi = 43, Luk = 1, Atk = 418, MAtk = 223, Def = 50, MDef = 5, Hp = 74000, Hit = 180, Flee = 141, MoveSpd = 135, MoveSpdRate = 1, AtkSpd = 1, AccessRange = 2, Transform_Skill = {10000001, 10031001}, move = 0, GroupID = 10081, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 182005}",
	[10086] = "{id = 10086, NameZh = '邪恶使者', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2602, AdventureValue = 35, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Undead', Nature = 'Shadow', Shape = 'M', Body = 10134, HeadDefaultColor = 0, Icon = 'Injustice', SpawnSE = '', DeathEffect = '', Desc = '生前侍奉恶魔，利用邪恶之术在各种人体身上做实验用来供奉。死后久久无法安息，被恶魔改造成不死之体来继续行恶，空下来还被古城其他魔物欺负。真正的死亡或许对其而言反而算作解脱吧…', Dead_Reward = {10860}, Level = 85, BaseExp = 539, JobExp = 379, Str = 5, Dex = 19, Agi = 17, Luk = 1, Atk = 409, MAtk = 247, Def = 75, MDef = 5, Hp = 82000, Hit = 210, Flee = 93, MoveSpd = 65, MoveSpdRate = 1, AtkSpd = 0.5, AccessRange = 2, Transform_Skill = {10000001, 10028001}, move = 0, GroupID = 10081, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 82003}",
	[10087] = "{id = 10087, NameZh = '史汀', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2603, AdventureValue = 35, AdventureReward = _EmptyTable, Condition = 1, Type = 'Monster', Zone = 'Field', Race = 'Formless', Nature = 'Earth', Shape = 'M', Body = 10067, HeadDefaultColor = 0, Icon = 'Sting', SpawnSE = '', DeathEffect = '', Desc = '虽然只是拥有意识的一大团泥浆，但却有自己的梦想和追求，希望有朝一日脱离下水道这黑暗潮湿的环境，在有阳光和树林的大自然里栖息游玩…若有人敢质疑其做白日梦，可不会有好下场的！', Dead_Reward = {10870}, Level = 87, BaseExp = 541, JobExp = 394, Str = 32, Dex = 13, Agi = 68, Luk = 1, Atk = 367, MAtk = 265, Def = 125, MDef = 20, Hp = 65000, Hit = 140, Flee = 106, MoveSpd = 55, MoveSpdRate = 1, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = {10000001, 10023001}, move = 0, GroupID = 10081, Behaviors = 19, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40, CopySkill = 210005}",
