	[56081] = "{id = 56081, NameZh = '邪恶老公公', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureReward = _EmptyTable, Type = 'Monster', Zone = 'Field', Race = 'Demon', Nature = 'Wind', Shape = 'M', Body = 10173, HeadDefaultColor = 0, Icon = 'Carat', LeftHand = 0, RightHand = 0, Hair = 0, Tail = 0, Mount = 0, SpawnSE = '', DeathEffect = '', Desc = '看上去外表像是圣诞老人，但其实是由至今被谜团包围的恶作剧精灵操控的一具衣服而已，因为会偷偷在圣诞老人给孩子们送礼物钻烟囱时盗走礼物而恶名昭著。', Dead_Reward = _EmptyTable, Level = 80, BaseExp = 1, JobExp = 1, Luk = 100, Atk = 205, MAtk = 49, Def = 200, MDef = 26, Hp = 119556, Hit = 481, Flee = 59, MoveSpd = 150, MoveSpdRate = 1, Scale = 1, AtkSpd = 0.48, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 4355, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable}",
