	[59002] = "{id = 59002, NameZh = '礼盒', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureReward = _EmptyTable, Type = 'Monster', Zone = 'Field', Race = 'Formless', Nature = 'Neutral', Shape = 'S', Body = 10169, HeadDefaultColor = 0, Icon = 'Mystcase', SpawnSE = '', DeathEffect = '', Desc = '发源于金字塔内，本来是古代国王陪葬物。但因盗墓者过多，促使宝箱内会放出邪恶的灵魂来对盗墓者进行强烈的攻击。不该拿的东西别碰，否则让你痛不欲生！', Dead_Reward = {40060, 40064}, Level = 1, BaseExp = 0, JobExp = 0, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 500, Hit = 999, Flee = 1, MoveSpd = 135, MoveSpdRate = 1, Scale = 3, AtkSpd = 0.5, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable}",
