	[60145] = "{id = 60145, NameZh = '阴影之书', ShowName = 0, Guild = '', Position = '混乱时空', AdventureRelevancyID = _EmptyTable, AdventureReward = _EmptyTable, Type = 'Monster', Zone = 'Field', Race = 'DemiHuman', Nature = 'Neutral', Shape = 'L', Body = 10148, HeadDefaultColor = 0, Icon = 'Elder', SpawnSE = '', DeathEffect = '', Desc = '约翰·海登堡出生于摩泽尔的特里腾海姆镇。他学识渊博，虽是魔法师，却在神学、炼金术、历史学、密码学等领域均颇有建树，是个令人高山仰止的天才人物。但是他不属于这个世界。', Dead_Reward = {11170, 40033}, Level = 104, BaseExp = 785, JobExp = 474, Atk = 1363, MAtk = 832, Def = 375, MDef = 27, Hp = 458796, Hit = 194, Flee = 96, MoveSpd = 90, MoveSpdRate = 1, Scale = 1.5, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, WmapHide = 1, LoadShowPose = _EmptyTable, ImmuneSkill = _EmptyTable, PassiveLv = 40}",
	[60146] = "{id = 60146, NameZh = '妖僧', ShowName = 0, Guild = '', Position = '混乱时空', AdventureRelevancyID = _EmptyTable, AdventureReward = _EmptyTable, Type = 'Monster', Zone = 'Field', Race = 'DemiHuman', Nature = 'Neutral', Shape = 'L', Body = 10148, HeadDefaultColor = 0, Icon = 'Elder', SpawnSE = '', DeathEffect = '', Desc = '妖僧拉斯普廷可谓是本世纪最有权势的黑巫师，以其阴邪的黑巫术幕后操控俄国宫廷，权力比肩皇帝。他曾借助催眠术治好了皇太子亚力克西斯的病，可也以之催眠了许多王宫贵族，成为了他的傀儡。然而他不属于这个世界。', Dead_Reward = {11170, 40033}, Level = 104, BaseExp = 785, JobExp = 474, Atk = 1363, MAtk = 832, Def = 375, MDef = 27, Hp = 458796, Hit = 194, Flee = 96, MoveSpd = 90, MoveSpdRate = 1, Scale = 1.5, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, WmapHide = 1, LoadShowPose = _EmptyTable, ImmuneSkill = _EmptyTable, PassiveLv = 40}",
	[60147] = "{id = 60147, NameZh = '不死抄写员', ShowName = 0, Guild = '', Position = '混乱时空', AdventureRelevancyID = _EmptyTable, AdventureReward = _EmptyTable, Type = 'Monster', Zone = 'Field', Race = 'DemiHuman', Nature = 'Neutral', Shape = 'L', Body = 10148, HeadDefaultColor = 0, Icon = 'Elder', SpawnSE = '', DeathEffect = '', Desc = '尼古拉·勒梅，一个平凡的抄写员。奇迹般地得到炼金奇书《犹太人亚伯拉罕之书》。经过多年精研此书，他洞悉了炼金术的秘密，炼成了所有炼金术士都梦寐以求的贤者之石，成为传奇的炼金术士。当他去世之时，无数炼金术士到他的墓室寻找贤者之石的秘密，除了空无一物的棺材以外，一无所获。只是他不属于这个世界。', Dead_Reward = {11170, 40033}, Level = 104, BaseExp = 785, JobExp = 474, Atk = 1363, MAtk = 832, Def = 375, MDef = 27, Hp = 458796, Hit = 194, Flee = 96, MoveSpd = 90, MoveSpdRate = 1, Scale = 1.5, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, WmapHide = 1, LoadShowPose = _EmptyTable, ImmuneSkill = _EmptyTable, PassiveLv = 40}",
	[60148] = "{id = 60148, NameZh = '灰袍巫师', ShowName = 0, Guild = '', Position = '混乱时空', AdventureRelevancyID = _EmptyTable, AdventureReward = _EmptyTable, Type = 'Monster', Zone = 'Field', Race = 'DemiHuman', Nature = 'Neutral', Shape = 'L', Body = 10148, HeadDefaultColor = 0, Icon = 'Elder', SpawnSE = '', DeathEffect = '', Desc = '灰色的胡子，灰色的斗篷，再加一顶蓝色的尖顶帽，灰袍巫师就是这样一个其貌不扬的老人，以至于很多人只把他当作一个普通的魔术师看待。然而也有传说，他竟是一个精灵。可是他与精灵又差别明显，精灵青春永驻，而他始终就是一个老人。而当他成为白袍巫师后，须发皆白，再穿上白袍，倒是有了些许令人瞩目的气度。但是他不属于这个世界。', Dead_Reward = {11170, 40033}, Level = 104, BaseExp = 785, JobExp = 474, Atk = 1363, MAtk = 832, Def = 375, MDef = 27, Hp = 458796, Hit = 194, Flee = 96, MoveSpd = 90, MoveSpdRate = 1, Scale = 1.5, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, WmapHide = 1, LoadShowPose = _EmptyTable, ImmuneSkill = _EmptyTable, PassiveLv = 40}",
	[60149] = "{id = 60149, NameZh = '野兽之王', ShowName = 0, Guild = '', Position = '混乱时空', AdventureRelevancyID = _EmptyTable, AdventureReward = _EmptyTable, Type = 'Monster', Zone = 'Field', Race = 'DemiHuman', Nature = 'Neutral', Shape = 'L', Body = 10148, HeadDefaultColor = 0, Icon = 'Elder', SpawnSE = '', DeathEffect = '', Desc = '阿莱斯特˙克劳利生于一个双亲都是基督教普里茅斯兄弟会的教友的家庭，该兄弟会也是基督教的基本教义派。因此，克劳利成长在一个严格遵守圣经的环境之中，但他却极度地蔑视基督教。他成年后成了一位神秘学者，或许正是由于他的离经叛道，人们都称他是“野兽之王”。只是他不属于这个世界。', Dead_Reward = {11170, 40033}, Level = 104, BaseExp = 785, JobExp = 474, Atk = 1363, MAtk = 832, Def = 375, MDef = 27, Hp = 458796, Hit = 194, Flee = 96, MoveSpd = 90, MoveSpdRate = 1, Scale = 1.5, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, WmapHide = 1, LoadShowPose = _EmptyTable, ImmuneSkill = _EmptyTable, PassiveLv = 40}",
	[60150] = "{id = 60150, NameZh = '坎卜斯的礼物·自私', ShowName = 0, Guild = '', Position = '金线兔玩偶', AdventureRelevancyID = _EmptyTable, AdventureReward = _EmptyTable, Type = 'Monster', Zone = 'Field', Race = 'Formless', Nature = 'Neutral', Shape = 'M', Body = 10169, HeadDefaultColor = 0, Icon = 'Mystcase', SpawnSE = '', DeathEffect = '', Desc = '只不过是个礼盒罢了，嗯，只不过是个礼盒罢了。人类啊~就是这样的一种生物，明知道很奇怪，哪里有点不对，却忍不住要去动手触碰，当你发现其实这是个宝箱怪的时候为时已晚啦~', Dead_Reward = {11230}, Level = 110, BaseExp = 1942, JobExp = 1200, Atk = 624, MAtk = 151, Def = 220, MDef = 56, Hp = 86835, Hit = 195, Flee = 206, MoveSpd = 30, MoveSpdRate = 1, Scale = 4, AtkSpd = 0.63, AccessRange = 0, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, WmapHide = 1, LoadShowSize = 1, LoadShowRotate = 30, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, PassiveLv = 40}",
