	[70045] = "{id = 70045, NameZh = '基尔瑟', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureReward = _EmptyTable, Type = 'Monster', Zone = 'EndlessTower', Race = 'Demon', Nature = 'Earth', Shape = 'S', Body = 20015, HeadDefaultColor = 0, Icon = 'Giearth', LeftHand = 0, RightHand = 0, Hair = 0, Tail = 0, Mount = 0, SpawnSE = '', DeathEffect = '', Desc = '资深矿工，拥有多年的挖矿经验，对于各类洞穴突发事件应付自如。常年生活工作在漆黑的洞穴和矿井中，不喜与人打交道。如果打搅其专心挖矿，他可会用铲柄好好伺候的！', Dead_Reward = {10450}, Level = 48, BaseExp = 1, JobExp = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 0, Hit = 1, Flee = 1, MoveSpd = 60, MoveSpdRate = 1, Scale = 0.65, AtkSpd = 0.54, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, GroupID = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable}",
