	[90001] = "{id = 90001, NameZh = '波利', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureReward = _EmptyTable, Type = 'Monster', Zone = 'Repair', Race = 'Plant', Nature = 'Water', Shape = 'M', Body = 10001, HeadDefaultColor = 0, Icon = 'boli', LeftHand = 0, RightHand = 0, Hair = 0, Tail = 0, Mount = 0, SpawnSE = '', DeathEffect = '', Desc = 'RO中的超人气魔物，以其卡哇伊的造型风靡万千玩家，风头直超同胞波波利甚多。非常喜欢苹果，会跟着给它苹果的人们，也会去捡拾各类掉落的道具。能力最弱，是人见人欺的对象，适合初心者练级。', Dead_Reward = _EmptyTable, Level = 1, BaseExp = 1, JobExp = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 0, Hit = 1, Flee = 1, MoveSpd = 35, MoveSpdRate = 2.5, AtkSpd = 0.53, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, GroupID = 10001, Behaviors = 11, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable}",
	[90002] = "{id = 90002, NameZh = '疯兔', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureReward = _EmptyTable, Type = 'Monster', Zone = 'Repair', Race = 'Brute', Nature = 'Neutral', Shape = 'S', Body = 10009, HeadDefaultColor = 0, Icon = 'fengtu', LeftHand = 0, RightHand = 0, Hair = 0, Tail = 0, Mount = 0, SpawnSE = '', DeathEffect = '', Desc = '有灵性的兔子，十分可爱的魔物，时而羞涩时而奔放，没事就喜欢蹦来蹦去。最喜欢胡萝卜，它的毛即使不用特别去打理也会相当的蓬松。初心者可以轻易对付。', Dead_Reward = _EmptyTable, Level = 3, BaseExp = 1, JobExp = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 0, Hit = 1, Flee = 1, MoveSpd = 60, MoveSpdRate = 2.5, Scale = 1.1, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, GroupID = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable}",
	[90003] = "{id = 90003, NameZh = '绿棉虫', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureReward = _EmptyTable, Type = 'Monster', Zone = 'Repair', Race = 'Insect', Nature = 'Earth', Shape = 'S', Body = 10007, HeadDefaultColor = 0, Icon = 'lvmianchong', LeftHand = 0, RightHand = 0, Hair = 0, Tail = 0, Mount = 0, SpawnSE = '', DeathEffect = '', Desc = '南门常见的怪物，是克瑞米的幼虫。新人们稍加小心就可以应付它。不过这些绿色的虫子偶尔也会进化成为虫蛹。如果梦见在身上有绿棉虫在蠕动，可是会痒好一阵子的~', Dead_Reward = _EmptyTable, Level = 5, BaseExp = 1, JobExp = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 0, Hit = 1, Flee = 1, MoveSpd = 35, MoveSpdRate = 1, Scale = 0.7, AtkSpd = 0.6, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, GroupID = 10011, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable}",
	[90004] = "{id = 90004, NameZh = '白鼠', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureReward = _EmptyTable, Type = 'Monster', Zone = 'Repair', Race = 'Brute', Nature = 'Shadow', Shape = 'S', Body = 10010, HeadDefaultColor = 0, Icon = 'Tarou', LeftHand = 0, RightHand = 0, Hair = 0, Tail = 0, Mount = 0, SpawnSE = '', DeathEffect = '', Desc = '长年生长在不见天日下的环境而突变的老鼠，对魔法感觉很敏锐。在阴暗潮湿的地方，繁殖能力超乎想象，为此还专门组织了下水道清理队时不时地控制这支超生游击队的数量。', Dead_Reward = _EmptyTable, Level = 11, BaseExp = 1, JobExp = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 0, Hit = 1, Flee = 1, MoveSpd = 125, MoveSpdRate = 2, AtkSpd = 0.57, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, GroupID = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable}",
	[90005] = "{id = 90005, NameZh = '盗虫', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureReward = _EmptyTable, Type = 'Monster', Zone = 'Repair', Race = 'Insect', Nature = 'Neutral', Shape = 'S', Body = 10011, HeadDefaultColor = 0, Icon = 'Thiefbug', LeftHand = 0, RightHand = 0, Hair = 0, Tail = 0, Mount = 0, SpawnSE = '', DeathEffect = '', Desc = '在阴暗的角落出现的昆虫，基本上就是蟑螂。名副其实的魔物，速度极快又会偷捡玩家的道具。刚转职完的玩家可要小心，轻视它的结果就是被它和它叫来的兄弟们围殴…', Dead_Reward = _EmptyTable, Level = 12, BaseExp = 1, JobExp = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 0, Hit = 1, Flee = 1, MoveSpd = 125, MoveSpdRate = 2, Scale = 0.7, AtkSpd = 0.78, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, GroupID = 0, Behaviors = 27, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable}",
