	[500010] = "{id = 500010, NameZh = '波利', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 1, AdventureValue = 50, AdventureReward = _EmptyTable, Condition = 9, Type = 'PetNpc', Zone = 'Field', Race = 'Plant', Nature = 'Water', Shape = 'M', Body = 10001, HeadDefaultColor = 0, Icon = 'boli', SpawnSE = '', DeathEffect = '', Desc = 'RO中的超人气魔物，以其卡哇伊的造型风靡万千玩家，风头直超同胞波波利甚多。非常喜欢苹果，会跟着给它苹果的人们，也会去捡拾各类掉落的道具。能力最弱，是人见人欺的对象，适合初心者练级。', Dead_Reward = _EmptyTable, Level = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 1, Hit = 1, Flee = 1, MoveSpd = 125, MoveSpdRate = 2, AtkSpd = 0.63, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, Features = 4}",
	[500020] = "{id = 500020, NameZh = '小野猪', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 6, AdventureValue = 50, AdventureReward = _EmptyTable, Condition = 9, Type = 'PetNpc', Zone = 'Field', Race = 'Brute', Nature = 'Earth', Shape = 'L', Body = 10156, HeadDefaultColor = 0, Icon = 'Savage_Baby', SpawnSE = '', DeathEffect = '', Desc = '杂食性动物，体躯健壮，四肢粗短，有厚实的鬃毛和尖锐的獠牙。虽然是猪，但肉很结实，体魄绝对强健。如果不幸将其惹恼，那对致命的獠牙可会让敌人吃不了兜着走！', Dead_Reward = _EmptyTable, Level = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 1, Hit = 1, Flee = 1, MoveSpd = 125, MoveSpdRate = 1, AtkSpd = 0.5, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, LoadShowSize = 1.4, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, Features = 4}",
	[500030] = "{id = 500030, NameZh = '溜溜猴', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 2, AdventureValue = 50, AdventureReward = _EmptyTable, Condition = 9, Type = 'PetNpc', Zone = 'Field', Race = 'Brute', Nature = 'Earth', Shape = 'S', Body = 10013, HeadDefaultColor = 0, Icon = 'Yoyo', SpawnSE = '', DeathEffect = '', Desc = '动作快，也很会捡拾道具。虽然很可爱，但是有点烦人。调皮捣蛋的天性让人又爱又恨，尤其是吃完香蕉随意丢香蕉皮的陋习难改，上次国王出行还滑过一跤……', Dead_Reward = _EmptyTable, Level = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 1, Hit = 1, Flee = 1, MoveSpd = 125, MoveSpdRate = 3.2, AtkSpd = 0.72, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, LoadShowSize = 1.4, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable}",
	[500040] = "{id = 500040, NameZh = '沙漠幼狼', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 4, AdventureValue = 100, AdventureReward = _EmptyTable, Condition = 9, Type = 'PetNpc', Zone = 'Field', Race = 'Brute', Nature = 'Fire', Shape = 'M', Body = 10080, HeadDefaultColor = 0, Icon = 'LittleWolf', SpawnSE = '', DeathEffect = '', Desc = '在沙漠生存下来的狼，有比一般狼更强的攻击力，并会主动攻击敌人。适者生存，大自然就是那么残酷。别看其眼睛小，说不定正在狡黠地在打目标的主意呢…', Dead_Reward = _EmptyTable, Level = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 1, Hit = 1, Flee = 1, MoveSpd = 125, MoveSpdRate = 1.4, Scale = 1.6, AtkSpd = 0.84, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, LoadShowSize = 2, LoadShowRotate = 30, LoadShowPose = {0, 0, -0.5}, ImmuneSkill = _EmptyTable, Features = 4}",
	[500050] = "{id = 500050, NameZh = '曼陀罗种子', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 3, AdventureValue = 150, AdventureReward = _EmptyTable, Condition = 9, Type = 'PetNpc', Zone = 'Field', Race = 'Plant', Nature = 'Earth', Shape = 'S', Body = 10122, HeadDefaultColor = 0, Icon = 'Mandala', SpawnSE = '', DeathEffect = '', Desc = '迷之植物，个子不大，天性羞涩，擅长捉迷藏。据说只有在迷藏森林服用一种特殊的药水来提升第六感后才能够发现它们。作为种子，萌萌的，遭人怜爱…', Dead_Reward = _EmptyTable, Level = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 1, Hit = 1, Flee = 1, MoveSpd = 125, MoveSpdRate = 1, AtkSpd = 0.57, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, Features = 4}",
	[500060] = "{id = 500060, NameZh = '鬼女', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 7, AdventureValue = 300, AdventureReward = _EmptyTable, Condition = 9, Type = 'PetNpc', Zone = 'Field', Race = 'Demon', Nature = 'Water', Shape = 'M', Body = 20014, HeadDefaultColor = 0, Icon = 'Sohee', RightHand = 40710, SpawnSE = '', DeathEffect = '', Desc = '生前是名貌美如花的普通女子，但不知何故最后含恨而死化为鬼魂继续游荡。或许是情愫的羁绊，亦或是反抗的不甘…谁知道呢，每个人都有自己的故事…', Dead_Reward = _EmptyTable, Level = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 1, Hit = 1, Flee = 1, MoveSpd = 125, MoveSpdRate = 1, AtkSpd = 0.69, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable}",
	[500070] = "{id = 500070, NameZh = '蛇女伊丝', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 5, AdventureValue = 200, AdventureReward = _EmptyTable, Condition = 9, Type = 'PetNpc', Zone = 'Field', Race = 'Demon', Nature = 'Shadow', Shape = 'L', Body = 10060, HeadDefaultColor = 0, Icon = 'Isis', SpawnSE = '', DeathEffect = '', Desc = '上半身裸露、下半身为蛇尾的恶魔，为俄赛里斯之妻。平时在金字塔无微不至地照顾俄赛里斯的生活起居。虽然丈夫绷带缠身，但浓浓的爱意丝毫没有减少。', Dead_Reward = _EmptyTable, Level = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 1, Hit = 1, Flee = 1, MoveSpd = 125, MoveSpdRate = 1, Scale = 1.3, AtkSpd = 0.62, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable}",
