	[500090] = "{id = 500090, NameZh = '毕帝特地龙', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 9, AdventureValue = 150, AdventureReward = _EmptyTable, Condition = 9, Type = 'PetNpc', Zone = 'Field', Race = 'Dragon', Nature = 'Earth', Shape = 'M', Body = 10062, HeadDefaultColor = 0, Icon = 'Petit', SpawnSE = '', DeathEffect = '', Desc = '龙族中比较普通的一种，只能在地面生活。早期米德加尔特的传奇冒险家毕帝特离开吉芬探索中无意间发现了龙区，后人就将普通的龙系魔物冠以他的名字…', Dead_Reward = _EmptyTable, Level = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 1, Hit = 1, Flee = 1, MoveSpd = 125, MoveSpdRate = 1, Scale = 1.2, AtkSpd = 0.57, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, LoadShowSize = 1.3, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, Features = 4}",
