	[500210] = "{id = 500210, NameZh = '小魔女', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 15, AdventureValue = 300, AdventureReward = _EmptyTable, Condition = 9, Type = 'PetNpc', Zone = 'Field', Race = 'DemiHuman', Nature = 'Undead', Shape = 'M', Body = 10152, HeadDefaultColor = 0, Icon = 'BlackWitch', LeftHand = 400175, Head = 400176, SpawnSE = '', DeathEffect = '', Desc = '在钟楼进行修行的小魔女，外表天真可爱，但真实年纪比许多人类的长者都要大，内心十分渴望成为既强大又有女性魅力的大魔女，自己非常介意被人类当作小孩子看，却会像孩子般的对自己认可的人类撒娇，对于火焰魔法有着极高的天赋，虽然看着很萌，一旦惹她不高兴的话，小魔女的魔焰可是任性又难缠的唷！', Dead_Reward = _EmptyTable, Level = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 1, Hit = 1, Flee = 1, MoveSpd = 125, MoveSpdRate = 1, Scale = 0.8, AtkSpd = 0.5, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, Features = 4}",
	[500220] = "{id = 500220, NameZh = '玩具士兵', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 16, AdventureValue = 150, AdventureReward = _EmptyTable, Condition = 9, Type = 'PetNpc', Zone = 'Field', Race = 'DemiHuman', Nature = 'Neutral', Shape = 'M', Body = 10168, HeadDefaultColor = 0, Icon = 'Cruiser', SpawnSE = '', DeathEffect = '', Desc = '玩具工厂生产出的玩具士兵，受到魔力的影响拥有了生命，在圣诞工厂内日夜不休地巡逻，虽然看起来像玩具一样可爱，但战斗的时候却像士兵一样有强大的作战能力与执行力，用“在下”自称，玩具枪是他的最爱，对自己的枪法和胡子十分自豪，对强大的人类会产生敬佩之情。', Dead_Reward = _EmptyTable, Level = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 1, Hit = 1, Flee = 1, MoveSpd = 125, MoveSpdRate = 1, Scale = 0.8, AtkSpd = 0.81, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, Features = 4}",
	[500230] = "{id = 500230, NameZh = '玩偶熊', ShowName = 0, Guild = '', Position = '', AdventureRelevancyID = _EmptyTable, AdventureSort = 17, AdventureValue = 200, AdventureReward = _EmptyTable, Condition = 9, Type = 'PetNpc', Zone = 'Field', Race = 'Formless', Nature = 'Neutral', Shape = 'M', Body = 10172, HeadDefaultColor = 0, Icon = 'Teddy_Bear', SpawnSE = '', DeathEffect = '', Desc = '在姜饼城徘徊的玩具熊，原本是给孩子们的准备的圣诞礼物，受到了魔力的影响拥有了生命，，寻找着自己心仪的主人，虽然外表看起来软绵绵的佷可爱，但是一旦生气或守护主人的时候，可以爆发出与萌萌的外表完全判若两熊的力量，从来不会忘记自己曾经许下的约定，讨厌背叛与被背叛，喜欢漂亮的玩具礼盒和小孩子，对自己选定的主人有很强的保护欲。', Dead_Reward = _EmptyTable, Level = 1, Atk = 1, MAtk = 1, Def = 1, MDef = 1, Hp = 1, Hit = 1, Flee = 1, MoveSpd = 125, MoveSpdRate = 1, Scale = 1, AtkSpd = 0.62, AccessRange = 2, Transform_Skill = _EmptyTable, move = 0, Behaviors = 3, LoadShowSize = 1, LoadShowRotate = 0, LoadShowPose = {0, 0, 0}, ImmuneSkill = _EmptyTable, Features = 4}",
